textOriginal:
Acho que uma deveria ser algo neste sentido:
- Multa por exceder a margem, com progressão do valor de acordo com distância da margem de erro;
- Limitar margem de erro (não sei se isso já existe, mas evitaria pesquisas mentirosas com margens altas para fugir de multa).

Sugiro:
- Ranckeamento dos institutos de pesquisas através de métricas ponderadas de acordo com o que foi divulgado e o resultado da urna;
- Limitação aos grandes veículos de imprensa quanto à divulgação de pesquisas de institutos com baixos scores no rancking;
- Obrigatoriedade de divulgação detalhada da metodologia adotada para que exposição pública dos resultados encontrados pelo instituto;
- Penalidade a institutos cujos resultados da semana que precede a eleição MAJORITÁRIA apresente distorção superior a 10% (para mais ou para menos) para qualquer dos candidatos;
- Proibição aos partidos políticos e/ou candidatos que divulguem resultados de institutos de baixo score de confiabilidade.
